import React from 'react'
import ToDo from './ToDo'

const ToDoList = (toDoes) => {

    console.log(toDoes.toDoes)

    if (toDoes.toDoes[0] !== undefined) {
  return (
    <ul className='toDoList'>
        {toDoes.toDoes.map((Todo) => (
            <ToDo 
            key={Todo.todo_id}
            Todo={Todo}/>
        ))}
    </ul>
  )
}
}

export default ToDoList
